import "../css/mainBlock.css";

function MySlider() {
  const settings = {
    arrows: false,
    dots: true,
    fade: true,
    autoplay: true,
    autoplay: 2500,
    pauseOnHover: false,
  };
  return (
    <div className="mySlider">
      <Slider {...settings} className="hello">
        <div className="slide1">
          <nav>
            <article>
              <h2>hheellooe</h2>
